INSERT INTO `projecta_ann` VALUES (1,'data:image/png;base64,','开服公告','开服公告','<p>亲爱的觉醒者们：</p><p><span style=\"color: rgb(29, 33, 39);\">破碎天灾降临，龙神陨落</span>，世事如棋。昔日之约烟灭，阵营四分五裂，但终归迎来曙光！龙都市，一座悬浮在空中的神迹堡垒，幸存者眼中的希望灯塔。随着灵魂碎片纷纷觉醒，龙都市的大门就此开启！恭喜您成功觉醒，现诚邀您前往龙都市召集<span style=\"color: rgb(29, 33, 39);\">那些神力尚在沉眠之中的觉醒者</span>，与他们携手驱散黑暗，守护最后的龙都市！祝您畅快冒险，享受觉醒征途！</p>','youxi',1700441650,1703984050,1),(2,'data:image/png;base64,','测试问题反馈','问题反馈','<p><br></p>','youxi',1700450218,1703992618,2),(5,'data:image/png;base64,','开服福利','开服福利','<p><br></p>','huodong',1700451144,1703993544,1);
/*!40000 ALTER TABLE `projecta_ann` ENABLE KEYS */;
UNLOCK TABLES;

