INSERT INTO `projecta_ann_subcontent` VALUES (1,'测试信息','<p>测试名称：曙光测试</p><p>测试时间：2023年11月27日11:00—2023年12月1日11:00（共5天）</p><p>测试类型：安卓·付费·删档测试</p><p>联系我们：</p><p><span style=\"color: rgb(229, 76, 94);\">&lt;官方Q群：313289362&gt;</span></p><p><span style=\"color: rgb(229, 76, 94);\">&lt;微信公众号：最后的龙都市&gt;</span></p><p>（如有任何疑问，请您随时与我们联系）</p>',1700441766,1703984166,1,1),(2,'游戏特色','<p><span style=\"color: rgb(29, 33, 39);\">1、自由交易</span></p><p><span style=\"color: rgb(29, 33, 39);\">“小服”运营“大服”社交，围绕“跨服交易”系统打造的全新一代经济体系。玩家能便捷收购自己需要的觉醒者碎片或藏品碎片，又能售出自己冗余的商品碎片来赚取龙晶，买卖自由，组建自己的最强觉醒者军团。</span></p><p><span style=\"color: rgb(29, 33, 39);\">&nbsp;</span></p><p><span style=\"color: rgb(29, 33, 39);\">2、创新策略副本</span></p><p><span style=\"color: rgb(29, 33, 39);\">在Roguelike的创新玩法下，玩家解锁进入不同主题的副本后，随机刷怪，策略翻格子，发现格子背后的隐藏要素，拉满期待值收获惊喜奖励。</span></p>',1700481800,1704024200,1,3),(4,'注意事项','<p>1、本次测试为不限号计费删档测试，无需激活测试资格，但是考虑到服务器承载以及体验稳定性的问题，我们将会在服务器注册到达一定数量后统一关闭下载入口，已下载的玩家注册和创角不受影响，后续可正常登录游戏。</p><p>2、为维护青少年绿色上网环境，本次测试需实名进入游戏体验。</p><p>3、本次测试内容并非游戏最终版本，目前游戏仍处于研发阶段，测试内容不代表游戏最终品质。</p>',1700451339,1703993739,2,1),(5,'测试问题反馈','<p>非常感谢各位觉醒者对本次“曙光测试”的踊跃参与，欢迎大家在测试期间通过官方途径对本次测试提出宝贵的意见和bug反馈，我们也会为提供宝贵意见的玩家给予相应奖励。</p><p>&nbsp;</p><p>~更多《最后的龙都市》相关情报，请持续关注我们~</p><p>祝各位觉醒者游戏愉快，期待与您一同见证《最后的龙都市》的成长！</p><p>《最后的龙都市》官方运营团队</p>',1700451469,1703993869,2,2),(6,'福利邮件','<p>测试期间，每日发送福利邮件，赠送大量召唤能量卡（抽卡券）、龙晶（钻石）、龙币（金币）以及各类强化道具！</p><p>第1日邮件福利：</p><p>能量卡*20、龙晶*3000；低级龙鳞*20；龙币*100k；英雄经验*50k</p><p>第2日邮件福利：</p><p>能量卡*20；龙晶*3000；阵营能量卡*10；卡拉*200</p><p>第3日邮件福利：</p><p>能量卡*20；龙晶*3000；阵营能量卡*10；同种自选基础阵营橙碎*60；同种自选阵营随机紫碎*30(X 4)</p><p>第4日邮件福利：</p><p>能量卡*20；龙晶*3000；阵营能量卡*10；同种自选基础阵营橙碎*60；同种自选阵营随机紫碎*30(X 4)</p><p>第5日邮件福利：</p><p>能量卡*20；龙晶*3000；阵营能量卡*10；同种自选基础阵营橙碎*60；同种自选阵营随机紫碎*30(X 4)</p>',1700454032,1703996432,5,1),(7,'登录礼','<p>测试期间，连续登录数日可领取百张召唤能量卡。</p>',1700454069,1703996469,5,2),(8,'多日目标','<p>测试期间，累计完成5天任务，可获得50张能量卡，4000龙晶，自选<span style=\"color: rgb(238, 130, 47);\">史诗英雄</span>及大量稀有养成资源。</p>',1700454097,1703996497,5,3),(9,'在线送好礼','<p>测试期间，每日在线时长达到活动条件，即可领取70张能量卡，3600龙晶。</p>',1700454125,1703996525,5,4),(10,'累计充值','<p>测试期间，玩家在游戏内累计充值达到活动条件，即可领取对应奖励。</p><p>充值6元奖励：强力史诗输出英雄、史诗重甲武器、大量养成资源</p><p>充值30元奖励：卓越英雄碎片*240、史诗装备*3、大量卡拉及养成资源</p><p>充值98元奖励：强力史诗输出英雄直升史诗+、卓越英雄碎片*360、大量龙币及装备养成材料</p>',1700454144,1703996544,5,5),(12,'返利规则','<p>本次测试为计费删档测试，测试结束后将会清空账号内游戏数据。</p><p>测试结束后，玩家在本次测试期间充值的所有金额在公测期间会按照1：2的比例返还代金券，即删档测试期间每一笔充值，公测期间玩家会得到两张等额的代金券。且<span style=\"color: rgb(229, 76, 94);\">只有绑定手机号的付费玩家账户，才能收到返利代金券哦</span>。</p><p>如：测试期间，玩家A充值一笔648元，则公测后玩家A获得2张648元代金券。</p><p>测试期间，玩家A充值一笔6元，1笔30元，则公测后玩家A获得2张6元代金券、2张30元代金券。</p>',1700482644,1704025044,1,2);
/*!40000 ALTER TABLE `projecta_ann_subcontent` ENABLE KEYS */;
UNLOCK TABLES;

